'%{
\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cbetween 2005 and 2012 more than one third of\n\nJune 13, 2017\n\u001c75\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cspouses. Bigger than work, friends, and school combined. 5\n\nNovember 27, 2015\n\u001c75\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNovember 28, 2015\n\u001c81\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cliterally hundreds of unread solicitations. As she scrolled and scrolled through message after message, the guys in the audience looked on in horror. They couldn’t believe the sheer volume of it all. The woman said she felt bad that a lot of the messages would probably just be deleted because she would never have time to respond to them all. The men in the audience collectively let out a pained groan. Throughout all our interviews, this was a consistent finding: In online dating women get a ton more attention than men.\n\nNovember 28, 2015\n\u001c83\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cthe images that resulted in the most conversation showed people doing interesting things. Sometimes faces didn’t even need to appear. A guy giving a thumbs-up while scuba diving. A woman standing in a barren desert. A woman playing a guitar. These photos revealed something deeper about their interests or their lives and led to more meaningful interaction\n\nNovember 28, 2015\n\u001c97\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNovember 28, 2015\n\u001c104\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNovember 28, 2015\n\u001c108\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNear the end of 2014, Tinder claimed that the average user logged on eleven times per day and spent approximately seven minutes on each session, meaning they are there for more than 1.25 hours each day. That’s an amazing amount of time to do anything, let alone move your fingers around a tiny screen.\n\nNovember 28, 2015\n\u001c109\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDecember 13, 2015\n\u001c116\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAt certain times, though, this “I need the best” mentality can be debilitating. I wish I could just eat somewhere that looks good and be happy with my choice. But I can’t. The problem is that I know somewhere there is a perfect meal for me and I have to do however much research I can to find it. That’s the thing about the Internet: It doesn’t simply help us find the best thing out there; it has helped to produce the idea that there is a best thing and, if we search hard enough, we can find it. And in turn there are a whole bunch of inferior things that we’d be foolish to choose.\n\nDecember 13, 2015\n\u001c117\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIf this mentality has so pervaded our decision making, then it stands to reason that it is also affecting our search for a romantic partner, especially if it’s going to be long-term. In a sense, it already has. Remember: We are no longer the generation of the “good enough” marriage. We are now looking for our soul mates. And even after we find our soul mates, if we start feeling unhappy, we get divorced\n\nBe careful of soul mate job. Not necessary\n\nDecember 13, 2015\n\u001c118\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSchwartz’s research, and a considerable amount of scholarship from other social scientists too, shows that when we have more options, we are actually less satisfied and sometimes even have a harder time making a choice at all.\n\nDecember 13, 2015\n\u001c119\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDecember 13, 2015\n\u001c121\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOn average, the maximizers put much more time and effort into their job search. They did more research, asked more friends for advice, and went on more interviews. In return, the maximizers in the study got better jobs. They received, on average, a 20 percent higher starting salary than the satisficers. After they started their jobs, though, Schwartz and his colleagues asked the participants how satisfied they were. What\n\nDecember 13, 2015\n\u001c121\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cthey found was amazing. Even though the maximizers had better jobs than the satisficers, by every psychological measure they felt worse about them. Overall, maximizers had less job satisfaction and were less certain they’d selected the right job at all. The satisficers, by contrast, were generally more positive about their jobs, the search process, and their lives in general. The satisficers had jobs that paid less money, but they somehow felt better about them\n\nAgain, the Grow engine should take this into account.\n\nDecember 13, 2015\n\u001c121\n\u0011\n\u0011"},{"ty":"ae","et":"inline","id":"i.0","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":105.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":150.9375,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":"Cover Image","i_cid":"13LDuQ6shz15KS1Eje2S9b42-_q1WKRfX0-LfH18","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.1","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":null,"i_cid":"1_68d_ZsTkY