,{"ty":"as","st":"text","si":4334,"ei":4352,"sm":{"ts_ff_i":false,"ts_fgc":"#757575","ts_fgc_i":false,"ts_va":"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":4353,"ei":4359,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="YVx7eD0U1QC5ZmY/CCPQSJV0S9A"  nonce="YVx7eD0U1QC5ZmY/CCPQSJV0S9A">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="YVx7eD0U1QC5ZmY/CCPQSJV0S9A"  nonce="YVx7eD0U1QC5ZmY/CCPQSJV0S9A">DOCS_modelChunk = [{"ty":"is","ibi":4360,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cmany young people are showing a lack of interest in romance, and also, again, I love ramen\n\nDecember 14, 2015\n\u001c141\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDecember 14, 2015\n\u001c143\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe number of men and women between eighteen and thirty-four who are not involved in any romantic relationship with the opposite sex has risen since\n\nDecember 14, 2015\n\u001c144\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c1987, from 49 percent to 61 percent for men and from 39 percent to 49 percent for women\n\nDecember 14, 2015\n\u001c144\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cA whopping one third of Japanese people under thirty have never dated, 4 and in a survey of those between thirty-five and thirty-nine, more than a quarter reported that they’d never had sex. 5 (Okay, that was the last “whopping” I’ll use.\n\nDecember 14, 2015\n\u001c144\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAlmost half of Japanese men and one third of women in their early thirties were still single as of 2005. 6\n\nDecember 14, 2015\n\u001c144\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJapan’s birthrate ranks 222nd out of 224 countries. 8 A report compiled with the government’s cooperation two years ago warned that by 2060 the number of Japanese will have fallen from 127 million to about 87 million, of whom almost 40 percent will be sixty-five or older. 9\n\nDecember 14, 2015\n\u001c144\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJapanese prime minister Shinzo Abe allocated $25 million in the 2014 fiscal budget for programs designed to get people to pair off and have babies, including government-funded dating services. An official survey conducted in 2010 showed that 66 percent of all prefecture governments and 33 percent of city/ward/town/village governments were implementing some form of marriage support. Even more do so today. 10\n\nDecember 14, 2015\n\u001c145\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSaga Prefecture has set up a Department of Connection that fixes up\n\nDecember 14, 2015\n\u001c145\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFinally, Fukui Prefecture recently launched an online dating site called the Fukui Marriage-Hunting Café, and couples who meet on the site and marry receive cash and gifts.\n\nDecember 14, 2015\n\u001c145\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSurveys suggest that about 60 percent of male singles in their twenties and thirties in Japan identify themselves as herbivores. 13 In the first group we held, one of the first to arrive was Akira. A good-looking young Japanese dude in a really sharp suit, Akira, thirty, looked like he was probably doing well for himself. He seemed like a successful, confident young man. This guy wasn’t an herbivore, right? We did interviews and focus groups with singles on four continents, and in most of them we broke the ice by asking people to tell us how many people they’d asked out or flirted with on their smartphones in the past few weeks. When we asked Akira that question, he just shrugged. Pretty much all\n\nDecember 14, 2015\n\u001c147\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIt’s charai [kinda sleazy, in a playboy way] to try to pick up a woman you don’t know. But also, if a girl said yes to me, I wouldn’t want to go out with her. I don’t like girls who would want to be with a guy openly like that. Looking, smiling, winking. I want a girl who’s seiso [pure].”\n\nDecember 14, 2015\n\u001c147\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBut it has to be someone with the right background, with the right family. If it was someone I just met somewhere, I’d be too embarrassed to tell my parents. They’d be disappointed.”\n\nDecember 14, 2015\n\u001c147\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI asked the women about the herbivore men and whether they wished guys would take more initiative. It was a resounding yes. These women yearned for the men in Japan to step up and just ask them out. From their perspective, the men’s extreme need for assurance and comfort from the women was irritating\n\nDecember 14, 2015\n\u001c148\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cmen’s confidence and sense of self is tied to their professional success. Everyone we talked to in Tokyo seemed to recall the booming eighties as a different era for romance, with salarymen, flush with cash, who could confidently approach a pretty woman and ask for her number without fear. This too is probably an exaggeration, but a telling one. With career jobs now gone, it’s not only harder for men to meet a partner but also harder for them to support her financially. So it makes sense that insecurity might leave men feeling more scared of rejection.\n\nDecember 14, 2015\n\u001c149\n\u0011\n\u0011"},{"ty":"te