hunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="YVx7eD0U1QC5ZmY/CCPQSJV0S9A"  nonce="YVx7eD0U1QC5ZmY/CCPQSJV0S9A">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="YVx7eD0U1QC5ZmY/CCPQSJV0S9A"  nonce="YVx7eD0U1QC5ZmY/CCPQSJV0S9A">DOCS_modelChunk = [{"ty":"is","ibi":8585,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNearly 50 percent of the single guys in Japan don’t even have friends of the opposite sex. 14\n\nDecember 14, 2015\n\u001c150\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDating online requires self-promotion. A dating profile is a kind of advertisement, a way of marketing yourself to prospective partners. But this attitude doesn’t really fit well with Japanese culture.\n\nExcept in shukatsu but maybe not even then...hmm\n\nDecember 14, 2015\n\u001c152\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAl, a young expat originally from Baltimore, tried to explain the motivations. “It’s like, I’m lonely, I’m scared of people ,” he said. “ I need to vent or just have a drink with someone who will listen to me and not judge me . They’re paying for the security. They’re paying not to be rejected.”\n\nDecember 14, 2015\n\u001c156\n\u0011\n\u0011\n\n\nINTRODUCTION\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAs I hit thirty, I started to despise the bar scene. I had experienced every single version of those nights. I knew all the possible outcomes, and I knew the probabilities of those outcomes. When you hit that point, you realize how fruitless trying to find love by barhopping can be; you have enough data to know that statistically the smartest thing for you to do when you walk into a bar is go to the bathroom, jerk off, and leave.\n\nDecember 14, 2015\n\u001c198\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDecember 14, 2015\n\u001c199\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDecember 16, 2015\n\u001c209\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001csome of the greatest joys of life come from nurturing and from what’s called “generativity.” People have strong strivings to build something, to do something, to leave something behind. And of course having children is one way of doing that. My own experience having children was that I discovered there were rooms in my heart that I didn’t even know were there. And if I had committed to a life of repeated sexual flings, I never would have opened those doors.\n\nDecember 16, 2015\n\u001c211\n\u0011\n\u0011"}
